export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},S4knqzbz7z:{data:{id:2724,attributes:{imdbId:"tt11214590",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYzdlMTMyZWQtZWNmMC00MTJiLWIyMWMtM2ZlZDdlYzZhNTc0XkEyXkFqcGdeQXVyMTMzNDE5NDM2._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"63%"},{Source:"Metacritic",Value:"59\u002F100"}],item_lang:{data:{id:3390,attributes:{title:"House of Gucci",plot:"House of Gucci is inspired by the family empire behind the Italian fashion house of Gucci. When Patrizia Reggiani (Lady Gaga), an outsider from humble beginnings, marries into the Gucci family, her unbridled ambition begins to unravel the family legacy and triggers a reckless spiral of betrayal, decadence, revenge, and ultimately...murder.",slug:"house-of-gucci"}}},books:{data:[{id:12975,attributes:{title:b,description:h,thumbnail:i,authors:[c],firstBook:true,published:j,publisher:k,subtitle:l}},{id:12976,attributes:{title:b,description:"This book traces the business fortunes of Italy's Gucci family from its first leather shop in Florence in 1921 to the loss of the fashion conglomerate in the 1990s. It investigates events suggesting that personal and legal squabbles of the dysfunctional second and third generations culminated in the 1995 murder of Maurizio Gucci.",thumbnail:d,authors:[c],firstBook:e,published:"2008-01-01",publisher:d,subtitle:m}},{id:12977,attributes:{title:b,description:"The startling and dramatic true story behind the murder of Maurizio Gucci, and the rise, fall, and rise again of the Gucci dynasty. This gripping account takes us behind the scenes of the trial of the century. From the day Guccio Gucci opened his modest leathergoods shop in Florence in the 1900s to the present, the book tells a riveting story of high fashion, high finance, and heartrending personal tragedy. Did Patrizia Reggiani murder her ex-husband, Maurizio Gucci, in 1995 because his spending was wildly out of control? Did she do it because her glamorous ex was preparing to marry his mistress, Paola Franchi? Or is there a possibility she didn't do it at all? Black and white photos.",thumbnail:d,authors:[c],firstBook:e,published:"2000-04-01",publisher:d,subtitle:m}},{id:12978,attributes:{title:b,description:h,thumbnail:i,authors:[c],firstBook:e,published:j,publisher:k,subtitle:l}}]}}},meta:{}}},prerenderedAt:1681309105275}}("movie","The House of Gucci","Sara Gay Forden","",null,"series",1,"SOON TO BE A MAJOR MOTION PICTURE from director Ridley Scott, starring Lady Gaga and Adam Driver The sensational true story of murder, madness, glamour, and greed that shook the Gucci dynasty, now fully updated with a new afterword On March 27, 1995, Maurizio Gucci, heir to the fabulous fashion dynasty, was slain by an unknown gunman as he approached his Milan office. In 1998, his ex-wife Patrizia Reggiani Martinelli--nicknamed \"The Black Widow\" by the press--was sentenced to 29 years in prison, for arranging his murder. Did Patrizia murder her ex-husband because his spending was wildly out of control? Did she do it because her glamorous ex was preparing to marry his mistress, Paola Franchi? Or is there a possibility she didn't do it at all? The Gucci story is one of glitz, glamour, intrigue, the rise, near fall and subsequent resurgence of a fashion dynasty. Beautifully written, impeccably researched, and widely acclaimed, The House of Gucci will captivate readers with its page-turning account of high fashion, high finance, and heart-rending personal tragedy.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=EExuyvAOiNgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2012-05-08","Harper Collins","A True Story of Murder, Madness, Glamour, and Greed","A Sensational Story of Murder, Madness, Glamour, and Greed"))